                <h3>HOME</h3> 
            </Link>
            <Link to="/create" className={style.Create}> 
                <h3> CREA TU POKEMON </h3>
            </Link>
            <div class="tenor-gif-embed" data-postid="19832394" data-share-method="host" data-aspect-ratio="3.48" data-width="100%"><a href="https://tenor.com/view/pokeball-pokemon-rolling-png-gif-19832394"></a><a href="https://tenor.com/search/pokeball-stickers"></a></div> <script type="text/javascript" async src="https://tenor.com/embed.js"></script>
        </div>
    )
};

export default NavBar;
